import React from 'react';

function Awards() {
    return ( 
        <div className='container'>
            <div  className='row'>
                <div className='col-md-6'></div>
                <img src='largestBroker.svg'/>
                <div className='col-md-6'></div>
            </div>
        </div>
     );
}

export default Awards;
